jQuery(document).ready(function(){$(".carousel").each(function(){if($(this).hasClass("image-carousel")){$(this).find(".item.active img").load(function(){$(this).parent().parent().height($(this).height())})}else{var b=0;var a=0;$(this).find(".item").each(function(){b=$(this).height();if(b>a){a=b}});$(this).find(".carousel-inner").height(a)}})});
